import '../estilos/Header.css';
import { SiCodeship } from "react-icons/si";
import { TiThMenu } from "react-icons/ti";
import { FaGithub } from "react-icons/fa";
import { FaLinkedin } from "react-icons/fa";
import { GrDocumentPdf } from "react-icons/gr";

export default function Header(){

    function BotaoVoltarAoTopo() {
        const irParaOTopo = () => {
          window.scrollTo(0, 0);
        }
    }

    return(
        <div className="header">
            <div className="headerLeft">
                <div className="iconeInicio">
                    <a href=""><SiCodeship/></a>
                </div>

                <div className="nomeInicio">
                    <a href="">Filipe Fernandes</a>
                </div>
            </div>
            <div className="headerRight">
                <a href="">Início</a>
                <a href="">Habilidades</a>
                <a href="">Projetos</a>
            </div>

        <div className="headerRightMobile">
            <div className="botaoCurriculo iconeResponsivo">
                <GrDocumentPdf />
            </div>
            <div className="botaoGitHub iconeResponsivo w25">
                <FaGithub />
            </div>
            <div className="botaoLinkedIn iconeResponsivo w25">
                <FaLinkedin />
            </div>
            <div className="botaoMobile iconeResponsivo w25">
                <TiThMenu />
            </div>
            <div className="menuMobile">
                <a href="">Início</a>
                <a href="">Habilidades</a>
                <a href="">Projetos</a>
            </div>
        </div>

      </div>
    );
}
